import java.util.HashSet;
import java.util.Set;

class Solution {
    public int[] findIntersectionValues(int[] nums1, int[] nums2) {
        // Convert arrays to sets for faster lookup and to remove duplicates
        Set<Integer> set1 = new HashSet<>();
        for (int num : nums1) {
            set1.add(num);
        }

        Set<Integer> set2 = new HashSet<>();
        for (int num : nums2) {
            set2.add(num);
        }

        // Count how many elements of set1 are present in set2
        int count1 = 0;
        for (int num : set1) {
            if (set2.contains(num)) {
                count1++;
            }
        }

        // Count how many elements of set2 are present in set1
        int count2 = 0;
        for (int num : set2) {
            if (set1.contains(num)) {
                count2++;
            }
        }

        // Return the counts in an array
        return new int[]{count1, count2};
    }
}
